import React from 'react';

import './App.css';
import {Route, Routes, BrowserRouter} from "react-router-dom";
import Header from "./Components/Header/Header";
import Sets from "./Components/Sets/Sets";
import Index from "./Components/Index/Index";
import Footer from "./Components/Footer/Footer";

type categoryType = {
    category: string,
    link: string
}
let categories: categoryType[] = [
    {
        category: 'СЕТЫ',
        link:'sets'
    },
    {
        category: 'РОЛЛЫ',
        link: "rolls"
    },
    {
        category: 'СУШИ',
        link: 'sushi'
    },
    {
        category: 'ПИЦЦА',
        link: 'pizza'
    },
    {
        category: 'САЛАТЫ',
        link: 'salads'
    },
    {
        category: 'БУРГЕРЫ',
        link: 'burgers'
    },
    {
        category: 'ВОКИ',
        link: 'woks'
    },
    {
        category: 'СУПЫ',
        link: 'soups'
    },
    {
        category: 'ГАРНИРЫ',
        link: 'garnish'
    },
    {
        category: 'НАПИТКИ',
        link: 'drinks'
    },
    {
        category: 'ПОКЕ',
        link: 'pokes'
    }]


function App() {
    return (
        <div className="App">
            <div>
                <Header categories={categories}/>
                <Routes>
                    <Route path="/" element={<Index/>}
                    />
                    <Route path="/sets" element={<Sets />}
                    />
                </Routes>
            </div>
            <Footer/>
        </div>
    );
}

export default App;
